//         {winner ? `Winner is: ${winner}` : isDraw ? "Its a draw" : ""}
//       </div>
//       <table>
//         <tbody>
//           <tr>
//             <Cell num={0} />
//             <Cell num={1} />
//             <Cell num={2} />
//           </tr>
//           <tr>
//             <Cell num={3} />
//             <Cell num={4} />
//             <Cell num={5} />
//           </tr>
//           <tr>
